import React from 'react';
//import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import BrandCard from '../components/BrandCard';
import './Home.scss'; // Import the styles

const Home: React.FC = () => {
  return (
    <div className="home">
      <Navbar />
      
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1>Trusted by Leading Brands</h1>
          <p>Discover our amazing partnerships</p>
        </div>
      </section>

      {/* Featured Brands */}
      <section className="brands-section">
        <h2>Featured Brands</h2>
        <div className="brands-container">
          {/* Example BrandCard, replace with dynamic data later */}
          <BrandCard name="Nike" logoUrl="https://via.placeholder.com/150" />
          <BrandCard name="Adidas" logoUrl="https://via.placeholder.com/150" />
          <BrandCard name="Puma" logoUrl="https://via.placeholder.com/150" />
        </div>
      </section>

      <Footer />
    </div>
  );
};

export default Home;
